            <Col span={7}>
              <div className="money-counting__panel__left">
                <div className="money-counting__panel__left__product-scanner"></div>
                <div className="money-counting__panel__left__product-info">
                  <h3>Thông tin sản phẩm</h3>
                </div>
              </div>
            </Col>
            <Col span={17}>
              <div className="money-counting__panel__right">
                <div className="money-counting__panel__right__topbar"></div>
                <div className="money-counting__pabel__right__shopping-cart"></div>
              </div>
            </Col>
          </Row>
        </div>

      </div>
    )
  }
}
export default withCookies(MoneyCounting)
